Here's an implementation of the Binary Search algorithm in PHP to find a specific element in a sorted array:

```php
function binarySearch($arr, $left, $right, $x) {
    while ($left <= $right) {
        $mid = floor(($left + $right) / 2);

        if ($arr[$mid] == $x) {
            return $mid;
        }

        if ($arr[$mid] < $x) {
            $left = $mid + 1;
        } else {
            $right = $mid - 1;
        }
    }

    return -1; // element not found
}

